          <Grid item xs={false} sm={2} />
          <Grid item xs={12} sm={8}>
            <Example />
            <SpecifiedDomainRadarChart />
          </Grid>
          <Grid item xs={false} sm={2} />
        </Grid>
        <Grid item container>
          <Grid item xs={false} sm={2} />
          <Grid item xs={12} sm={8}>
            <Content />
          </Grid>
          <Grid item xs={false} sm={2} />
        </Grid>
      </Grid>
    </div>
  );
};

export default Detail;
